I finally solved the problem by converting float* floatarr = ort_outputs[0].GetTensorMutableData<float>(); to a tensor and then saving it as a mat. I suspect that since I'm saving an rgb image, I can't convert float* floatarr to mat directly and need to go through a Tensor as an intermediary.
Here's how I found it on the web hopefully it will help others:
`std::vector<cv::Mat> results;
	torch::Tensor result_r = torch::from_blob(floatarr, { sr_h,sr_w,1 });
	torch::Tensor result_g = torch::from_blob(&floatarr[sr_h * sr_w - 1], { sr_h,sr_w,1 });
	torch::Tensor result_b = torch::from_blob(&floatarr[sr_h * sr_w * 2 - 1], { sr_h,sr_w,1 });
	torch::Tensor result = torch::cat({ result_r, result_g, result_b }, 2);
	result = result.mul(255);
	result = result.clamp(0, 255);
	result = result.to(torch::kU8);
	cv::Mat resultImg(sr_h, sr_w, CV_8UC3);
	std::memcpy((void*)resultImg.data, result.data_ptr(), sizeof(torch::kU8)* result.numel());
	//cv::cvtColor(resultImg, resultImg, cv::COLOR_RGB2BGR);
	results.push_back(resultImg);`
